import React, { Component } from 'react'
import './footer.css';


export default class footer extends Component {
    render() {
        return (
            <div>
                <footer className="site-footer">
                    <div className="container">
                        <div className="row">
                            <ul className="col-4 col-sm-2 offset-1">
                                <li><a href="http://instagram.com/"><i class="bi bi-facebook"></i></a></li>
                                <li> <a href="http://www.facebook.com/"><i class="bi bi-instagram"></i></a></li>
                                <a role="button" href="tel:+14109420001"><i class="bi bi-telephone-fill" /></a>
                                <a role="button" href="mailto:notreal@notreal.co"><i class="bi bi-envelope-fill"></i></a>
                            </ul>
                        </div>
                    </div>
                </footer>

            </div>
        )
    }
}
